import React, { useEffect, useState } from 'react';
import Link from 'next/link'
const Home = () => {
    const [count, setCount] = useState(0);
    return (
        <>你好啊洗吧<br />
            {count}
            <button onClick={() => setCount(count + 1)}>加1</button>
            <Link href='/user'>
                <a>去user</a>
            </Link>
        </>
    )

};
export default Home;
